import React from 'react';
import {
  BarChart,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  Bar,
} from 'recharts';

function RegionsChart({ data, dataKey }) {
  return (
    <BarChart
      width={1000}
      height={300}
      style={{ margin: 'auto' }}
      margin={{ top: 30, left: 20, right: 30 }}
      data={data}
      className="font-weight-bold bebas-font  mar"
    >
      <CartesianGrid strokeDasharray="3 3" />
      <XAxis dataKey="region" x={20} />
      <YAxis />
      <Tooltip />
      <Legend />
      <Bar dataKey={dataKey} fill="#0C2C54" />
    </BarChart>
  );
}

export default RegionsChart;
